	(1520, 'taunt', 'Don’t be delayin’ your fate. Come to me now. I make your sacrifice quick.', 0, 0, '', 'Ne retarde pas ton destin. Viens à moi maintenant. Je rends ton sacrifice rapide.', '', '', '', 'No demores tu destino. Ven a mí ahora. Hago que tu sacrificio sea rápido.', '', ''),
