	(1525, 'taunt', 'Death comes. Will your conscience be clear? ', 0, 0, '', 'La mort arrive. Est-ce que ta conscience sera claire ?', '', '', '', 'La muerte llega. ¿Tu conciencia estará limpia? ', '', ''),
