	(1529, 'taunt', 'Hostile entities detected. Threat assessment protocol active. Primary target engaged. Time minus thirty seconds to re-evaluation.', 0, 0, '', 'Entités hostiles détectées. Protocole d’évaluation des menaces activé. Cible principale engagée. Temps moins trente secondes avant réévaluation.', '', '', '', 'Entidades hostiles detectadas. Protocolo de evaluación de amenazas activo. Objetivo principal comprometido. Tiempo menos treinta segundos para la reevaluación.', '', ''),
	(1530, 'taunt', 'New toys? For me? I promise I won’t break them this time!', 0, 0, '', 'De nouveaux jouets ? Pour moi ? Je te promets que cette fois, je ne les casserai pas !', '', '', '', '¿Juguetes nuevos? ¿Para mi? ¡Te prometo que no los romperé esta vez!', '', ''),
