	(1536, 'taunt', 'Tell me... tell me everything!  Naughty secrets! I’ll rip the secrets from your flesh!', 0, 0, '', 'Dis-moi... dis-moi tout ! Les petits secrets coquins ! Je vais arracher les secrets de ta chair !', '', '', '', 'Cuéntame... ¡cuéntame todo! ¡Secretos traviesos! ¡Arrancaré los secretos de tu carne!', '', ''),
	(1537, 'taunt', 'Prepare yourselves, the bells have tolled! Shelter your weak, your young and your old! Each of you shall pay the final sum! Cry for mercy, the reckoning has come!', 0, 0, '', 'Préparez-vous, les cloches ont sonné ! Protégez vos faibles, vos jeunes et vos anciens ! Chacun d’entre vous paiera le prix final ! Pleurez miséricorde, l’heure du jugement est arrivée!', '', '', '', '¡Prepárense, las campanas han doblado! ¡Abriga a tus débiles, a tus jóvenes ya tus viejos! ¡Cada uno de ustedes pagará la suma final! Clama por misericordia, el ajuste de cuentas ha llegado!', '', ''),
	(1538, 'taunt', 'Where in Bonzo’s brass buttons am I?', 0, 0, '', 'Où diable suis-je?', '', '', '', '¿Dónde estoy en los botones de latón de Bonzo?', '', ''),
	(1539, 'taunt', 'I can bear it no longer! Goblin King! Goblin King! Wherever you may be! Take this <target> far away from me!', 0, 0, '', 'Je n’en peux plus! Roi des Gobelins! Roi des Gobelins! Où que tu sois! Emmène cette %cible% loin de moi!', '', '', '', '¡No puedo soportarlo más! ¡Rey de los duendes! ¡Rey de los duendes! ¡WHERE quiera que estés! ¡Lleva a este <target> lejos de mí!', '', ''),
	(1540, 'taunt', 'You have thirteen hours in which to solve the labyrinth, before your baby brother becomes one of us... forever.', 0, 0, '', 'Tu as treize heures pour résoudre le labyrinthe, avant que ton petit frère ne devienne l’un d’entre nous... pour toujours.', '', '', '', 'Tienes trece horas para resolver el laberinto, antes de que tu hermanito se convierta en uno de nosotros... para siempre', '', ''),
	(1541, 'taunt', 'So, the <subzone> is a piece of cake, is it? Well, let’s see how you deal with this little slice... ', 0, 0, '', 'Alors, la <subzone> est du gâteau, vous dites? Hmm, voyons comment vous vous en sortez avec cette petite portion...', '', '', '', 'Entonces, la <subzone> es pan comido, ¿verdad? Bueno, veamos cómo lidias con esta pequeña porción... ', '', ''),
	(1542, 'taunt', 'Back off, I’ll take you on, headstrong to take on anyone, I know that you are wrong, and this is not where you belong', 0, 0, '', 'Alors, recule, je vais m’occuper de toi, déterminé à affronter n’importe qui, je sais que tu as tort, et ce n’est pas là que tu appartiens', '', '', '', 'Atrás, te enfrentaré, testarudo para enfrentar a cualquiera, sé que estás equivocado, y este no es el lugar al que perteneces', '', ''),
